import React from 'react';
import Sdata from './Sdata';
import Cards from './Cards';

function Amazon(){
    return (
        <Cards 
        key = {Sdata[4].id}
        crdimg = {Sdata[4].simgsrc}
        title= {Sdata[4].stitle}
        category= {Sdata[4].scategory} 
        link= {Sdata[4].slink} 
      />
    )
}

export default Amazon;
